import SearchOptionUI from "../SearchOptionUI";

const checkboxTime = [
  "today",
  "yesterady",
  "three days ago",
  "a week ago",
  "a month ago",
  "three months ago",
  "six months ago",
  "a year ago",
];

const test = [{ text: "today", value: 0 }];

function SearchOptionTime() {
  return <SearchOptionUI label="time" checkboxItem={checkboxTime} />;
}

export default SearchOptionTime;
